import React from "react";
import styled from "styled-components";

const Login = () => {
  return (
    <LoginWrapper>
      <input type="email" />
      <input type="password" />
      <button type="submit">로그인</button>
      <button type="button">회원가입</button>
    </LoginWrapper>
  );
};

export default Login;

const LoginWrapper = styled.div``;
